var box = scene.getObjectByName( 'Box' );

var group = new THREE.Group();
scene.add( group );

for ( var i = 0; i < 50; i ++ ) {

	var clone = box.clone();
	clone.position.x = Math.random() * 8 - 4;
	clone.position.y = Math.random() * 20 - 10;
	clone.position.z = Math.random() * 8 - 4;
	clone.rotation.x = Math.random() * Math.PI;
	clone.rotation.y = Math.random() * Math.PI;
	clone.rotation.z = Math.random() * Math.PI;
	clone.scale.setScalar( Math.random() * 0.5 + 0.15 );
	clone.userData.speed = Math.random() * 0.05 + 0.025;
	group.add( clone );

}

box.visible = false;


function update( event ) {

	var time = event.time * 0.0002;

	camera.position.x = Math.sin( time ) * 8;
	camera.position.z = Math.cos( time ) * 8;
	camera.lookAt( scene.position );

	for ( var i = 0; i < group.children.length; i ++ ) {

		var clone = group.children[ i ];
		clone.position.y += clone.userData.speed;
		clone.rotation.x += 0.01;
		clone.rotation.y += 0.02;

		if ( clone.position.y > 10 ) clone.position.y = - 10;

	}

}
